on";s:2226:"üå∑ STEPHENS HOUSE & GARDENS üå∑
This peaceful oasis in Finchley is another amazingly free place to while away the morning/afternoon and enjoy both nature & historic surrounds. The grade II listed Victorian mansion (also known as Avenue House) with landscaped gardens by Robert Marnock, was gifted for people‚Äôs enjoyment by Henry Charles 'Inky' Stephens of the Stephens' Ink Company. It was often visited by Spike Milligan, hence its impressive statue of him ‚Äòin conversation‚Äô on a bench.

With beautiful lawns for a run, rock garden, carp pond and wooded walk, there‚Äôs lots for little ones to explore. There are natural play features dotted around to climb on, and fantastic play areas: a ‚Äòwild play‚Äô zone next to a fenced area for younger children that also contains some more adventurous equipment to one side for older ones. The play area is wide-ranging, including all the classics but also items that make it a bit different - like a tunnel through a little hill, and a sand pit with sit-on digger (for older children really but we just about managed to help our toddler have a go!). I‚Äôd recommend bringing some sand toys for the latter as some families wisely had and of course our toddler wanted in on that action! There‚Äôs also a Children‚Äôs Trail that you can download from Stephens House website with things to spot along your way.

We stopped off for hot chocolate & delicious carrot cake in the lovely courtyard cafe, which was great value at ¬£5 in total for both! There are great events coming up too: Street Food on 13th Sep, plus Gin on the Terrace on 17th, and sculpture trail from 18-27th!

One reason for our visit today was also to try a @kangarookidsgroup drama, music & movement class held in the house - it was fab! So nice to be back at a baby/toddler group after lockdown and it‚Äôs for 0-4s so both baby and toddler could go and you can book by the session. Definitely lots of fun!

